typedef SV* Perl_Scalar;


#include "pcre.h"

pcre* compile(const char *pat, int opt) {
    pcre *re;
    const char *error;
    int erroffset;
    re = pcre_compile(
        pat, opt,
        &error,
        &erroffset,
        NULL
    );
    return re;
}

Perl_Scalar execute(const pcre *re, const char *str, int opt) {
    int rc;
    int *ovector;
    AV* seq = newAV();
    int i;
    unsigned long int length;

    pcre_fullinfo(
        re,
        NULL,
        PCRE_INFO_SIZE,
        &length
    );

    ovector = malloc(sizeof(int) * length);

    rc = pcre_exec(
        re,         
        NULL,        
        str,
        strlen(str),
        0,
        0,
        ovector,
        30
    );

    if (rc >= 0) {
        for (i = 0; i < (rc*2); i++ ) {
            av_push(seq, newSViv(ovector[i]));
        }
    }

    free(ovector);

    return newRV_inc((SV*)seq);
}


